/*

Usage: 
    npm install jspdf
    node random.js

*/


const jsPDF = require("jspdf").jsPDF

// Cyrillic font as binary string
const font = ''

const simpleQuestions = `    javascript?  let const var.
  IIFE  javascript.   
  DOM?
  DOM element  javascript
  javascript  .     2  .
     css . ( 3)
     ?
     debugger.
   console.log
    stopPropagation?  
    preventDefault?  
  http? ,    httpRequest  httpResponse
        http.   
      http   
  uri?   uri
    http   javascript   
  npm     ?
  semVer?         
   dependencies, devDependencies, optionalDependencies  
    package.json?    
  nodejs,  , , ?`.split('\n')

const otherQuestions = `  longpolling,   ?
  websocket   ?`.split('\n')

const students = ` 
  
  
  
  
  
  
  
  
  
  
  
  
   
  
  
  
  
  
  
  
  
  
  
  
 
  
  
  
  
  
  
  
  
  
  
  
  
  
 
 
  `.split('\n')


const getRandomQuestions = (number, questions) => {
    const randomQuestions = new Set()

    while (randomQuestions.size < number) {
        randomQuestions.add(questions[Math.floor(Math.random() * questions.length)])
    }

    return [...randomQuestions]
}

const res = []


for (const studentName of students) {
    res.push({
        studentName,
        questions: [...getRandomQuestions(4, simpleQuestions), ...getRandomQuestions(1, otherQuestions)]
    })
}

const doc = new jsPDF()
doc.addFileToVFS('CyrillicFont.ttf', font)
doc.addFont('CyrillicFont.ttf', 'Cyrillic', 'normal');
doc.setFont('Cyrillic')
doc.setFontSize(12)

res.forEach((item, pos) => {
    const text = `  1 20.10.2022 \n
    ${item.studentName} \n
    : \n${item.questions.map((q, i) => `${i + 1}) ${q}`).join('\n')}`

    if (pos != 0) doc.addPage()
    doc.text(text, 10, 10)
})

doc.save('rubesh.pdf')
